function feedbacksubmit(e){var n=$(e.target)[0],t=new FormData(n);$.ajax({url:n.action,type:"POST",data:t,processData:!1,contentType:!1,success:function(e){$("#submitting-feedback").hide(),$("#success-message").show()},error:function(e,n,t){console.error(t)}}),$(e.target).hide(),$("#submitting-feedback").show()}function initFeedback(){var e=$(".ntg-feedback-form"),n=e.find("fieldset input"),t=e.find("fieldset label"),c=e.find(".collapse");function i(e){c.collapse("show"),e.removeClass("unselected")}t.each(function(){$(this).on("click",function(){i($(this))})}),n.each(function(){$(this).on("focus",function(){i($(this).next())})})}$(document).ready(function(){initFeedback()});